import java.util.ArrayDeque;

public class Main {
    public static void main(String[] args) {
        ArrayDeque<Integer> deque = new ArrayDeque<>();

        // Unrelated initial fill
        for (int i = 0; i < 10; i++) {
            deque.add(i);
        }

        int misleadingVar = 0;
        for (int i = 0; i < 5; i++) {
            misleadingVar += i;
        }

        // Conditional logic with unrelated effect
        if (misleadingVar > 10) {
            deque.addFirst(99);
        }

        // Meaningless operations
        int operation = (misleadingVar * 5) / 10;

        boolean flag = (operation % 2 == 0);

        if (flag) {
            deque.addLast(100);
        } else {
            deque.addFirst(101);
        }

        /* write */ deque.add(42);

        // Perform more complex operations
        for (int i = 0; i < 3; i++) {
            deque.poll();
            deque.offer(50 + i);
        }

        // More manipulations not affecting the read target
        for (int num : deque) {
            System.out.println("Intermediate Value: " + num);
        }

        /* read */ int ret = deque.peek();

        System.out.println("Read Value: " + ret);
    }
}
